import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
import Login from "./Component/Login/login"

function App() {
  return (
    <BrowserRouter
      future={{
        v7_startTransition: true,
        v7_relativeSplatPath: true,
      }}
    >
      <Routes>
        <Route path='/login' element={<Login />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
